INSERT INTO qgep.is_dictionary_od_field (class_id, attribute_id, table_name, field_name, field_name_en, field_name_de, field_name_fr, field_name_it, field_description_en, field_description_de, field_description_fr, field_description_it) VALUES (9, 3514, 'od_waste_water_treatment_plant', 'cod', 'cod', 'CSB', 'dco', 'zzz_CSB', 'Abbreviation for chemical oxygen demand (COD). ', 'Abkürzung für den chemischen Sauerstoffbedarf. Die englische Abkürzung lautet COD. Mit einem starken Oxydationsmittel wird mehr oder weniger erfolgreich versucht, die organischen Verbindungen der Abwasserprobe zu CO2 und H2O zu oxydieren. Als Oxydationsmi ', 'Elle représente la teneur totale de l''eau en matières organiques, qu''elles soient ou non biodégradables. Le principe repose sur la recherche d''un besoin d''oxygène de l''échantillon pour dégrader la matière organique. Mais dans ce cas, l''oxygène est fourni ', NULL);
