
CREATE VIEW qgep.is_dictionary_value_list AS 
  SELECT p.relname AS vl_name, vl.* 
  FROM qgep.is_value_list_base vl, pg_class p 
  WHERE vl.tableoid = p.oid;


CREATE TABLE qgep.is_dictionary_od_table
(
  id integer NOT NULL,
  tablename text,
  name_en text,
  shortcut_en character(2),
  name_de text,
  shortcut_de character(2),
  name_fr text,
  shortcut_fr character(2),
  CONSTRAINT pkey_qgep_is_dictonary_id PRIMARY KEY (id ),
  CONSTRAINT unq_qgep_is_dictonary_tablename UNIQUE (tablename )
)
WITH (
  OIDS = False
);






CREATE TABLE qgep.is_dictionary_od_field (
    id serial NOT NULL,
    class_id integer,
    attribute_id integer,
    table_name character varying(80),
    field_name character varying(80),
    field_name_en character varying(80),
    field_name_de character varying(100),
    field_name_fr character varying(100),
    field_name_it character varying(100),
    field_description_en text,
    field_description_de text,
    field_description_fr text,
    field_description_it text,
    CONSTRAINT is_dictionary_od_field_pkey PRIMARY KEY (id)
);





